INSERT INTO `v1_5be6d51602644f505cfc0db5189300946d64592e8c9dafc2cf912d8b6bf6dd19` VALUES ("グランハニーコースター", 1, "縦横無尽に飛び回るハチさんに乗って\nパンケーキを焼いているかばばん君に\nハチミツを届けてあげましょう♪\nアトラクション最大の絶叫ポイントは、\nパーク名物・ハチミツ池への急降下！\n魔法の写真撮影サービスも\n大好評実施中ですます～♪");
INSERT INTO `v1_5be6d51602644f505cfc0db5189300946d64592e8c9dafc2cf912d8b6bf6dd19` VALUES ("ぷかぷかフラワー観覧車", 2, "遊園地デートの定番といえば観覧車♪\nでも二人っきりはちょっとドキドキ…\nそんな恥ずかしがり屋さんでも安心の\nとある秘密が隠されていますです♪\nその秘密とは、乗ってみてのお楽しみ♪\nお付き合いしたてのお二人も\nおひとり様にもオススメです♪");
INSERT INTO `v1_5be6d51602644f505cfc0db5189300946d64592e8c9dafc2cf912d8b6bf6dd19` VALUES ("ベリーシュガリーコーヒーカップ", 3, "甘いお菓子の後はコーヒーブレイク♪\n回転するカップ、かわいいですよね～♪\n真ん中のハンドルを回すと、ぐんぐん\nスピードが上がりますので、回転数の\n競い合いも楽しめちゃいますです～♪\nハンドルのドーナツはおやつに\n召し上がってくださいませ～♪");
INSERT INTO `v1_5be6d51602644f505cfc0db5189300946d64592e8c9dafc2cf912d8b6bf6dd19` VALUES ("ダイブ・トゥ・ザ・３Dワールド", 4, "マジックアイテム、３Dメガネが見せる\n立体映像の新感覚アトラクションです♪\n誰でも座れるフラットシートですので\n体の大きさが違うお友達同士でも\n一緒に大盛り上がりできちゃいますよ♪\nさあ、果てしない大空へ\n飛び込んじゃいましょう♪");
